import React from "react";
import FundraisingProject from "./FundraisingProject";

const styles = {
    ul: {
        listStyle: 'none',
        margin: 0,
        padding: 0
    }
}

function allProjects() {
    fetch(`http://localhost:18080/fundraising-projects`, {
        method: 'GET'
    }).then(response => response.json())
        .then(json => {console.log(json)});
}

allProjects();

export default function FundraisingProjects() {

    return (
        <ul style={styles.ul}>
            <FundraisingProject/>
            <FundraisingProject/>
            <FundraisingProject/>
        </ul>
    );
}
